--
-- Table structure for table `am_menu`
--

DROP TABLE IF EXISTS `am_menu`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `am_menu` (
  `menu_id` char(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '菜单id',
  `name` char(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '国际化对应的name',
  `menu_type` enum('dir','menu','button') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '菜单类型（dir:目录，menu:菜单,button:按钮）',
  `path` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '路由url',
  `icon` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '菜单图标',
  `component` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '菜单对应的文件路径',
  `redirect` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '路由重定向地址',
  `parent_id` char(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '父级id',
  `target` enum('_blank','_self','_parent','_top') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '当path是一个url，点击新窗口打开',
  `permission` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '菜单标识(页面按钮权限控制)',
  `layout` enum('side','top','mix') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '是否显示layout布局（side:侧边菜单，top:顶部菜单,mix:混合菜单）',
  `navTheme` enum('dark','light') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '导航菜单的主题（dark:暗黑风格，light:亮色风格）',
  `headerTheme` enum('dark','light') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '顶部导航的主题，mix 模式生效（dark:暗黑风格，light:亮色风格）',
  `hideChildrenInMenu` int DEFAULT NULL COMMENT '是否隐藏子路由',
  `hideInMenu` int DEFAULT NULL COMMENT '是否隐藏菜单，包括子路由',
  `hideInBreadcrumb` int DEFAULT NULL COMMENT '是否在面包屑中隐藏',
  `headerRender` int DEFAULT NULL COMMENT '是否显示顶栏',
  `footerRender` int DEFAULT NULL COMMENT '是否显示页脚',
  `menuRender` int DEFAULT NULL COMMENT '当前路由是否展示菜单',
  `menuHeaderRender` int DEFAULT NULL COMMENT '当前路由是否展示菜单顶栏',
  `flatMenu` int DEFAULT NULL COMMENT '子项往上提，只是不展示父菜单',
  `fixedHeader` int DEFAULT NULL COMMENT '固定顶栏',
  `fixSiderbar` int DEFAULT NULL COMMENT '固定菜单',
  `founder` char(36) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '创建人',
  `sort` int NOT NULL COMMENT '排序',
  `status` int NOT NULL COMMENT '菜单状态（0:禁用，1：正常）',
  `created_time` datetime NOT NULL,
  `updated_time` datetime NOT NULL,
  PRIMARY KEY (`menu_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC;
/*!40101 SET character_set_client = @saved_cs_client */;

